import React from 'react'
import { useParams } from 'react-router-dom'
import InformacionEdit from './informacionEdit'
import './estilosComponentes/editMenu.css'
import ListaIngredientesMenu from './ListaIngredientesMenu'

const EditMenu = () =>{
    const parametros=useParams()
    return (
        <div className='editpage'>
            <InformacionEdit parametros={parametros}/>
            <ListaIngredientesMenu parametros={parametros} />
        </div>
    )
}

export default EditMenu
